import React from 'react';
import './App.scss';
import Nav from './components/Nav';
import Main from './components/Main';

function App() {
  return (
    <div className="outerWrap">
      <div className="App">
        <Nav />
        <Main />
      </div>
      <div className="musicControls">
        music musicControls
      </div>
    </div>
  );
}

export default App;
